                    <div 
                        key={foodItem.title}
                        className="food-item-container"
                    >
                        <h1>{foodItem.extraDisplay}</h1>
                        <h2>
                            {foodItem.title} 
                        </h2>
                        <p>
                            {foodItem.price}
                        </p>
                        <p>
                            {foodItem.description}
                        </p>
                    </div>
                )
            })}
        </div>
    )
}

